// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

interface CrowdsaleForRetail {
    function joined(address account) external view returns (uint256);
}

contract AirdropForStake is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    event transferToken(address wallet, address account, uint256 amount);
    uint256 public constant rateDenominator = 1000;

    // address airdrop amount
    mapping(address => uint256) public airdropAmount;

    IERC20 public token;
    address public tokenWallet;
    uint256 public minDATStakeAmount;
    uint256 public stakeRate;
    uint256 public stakeRateMultiple;
    address public crowdsaleForRetailAddress;
    IERC20 public crowdsaleToken;

    CrowdsaleForRetail private _crowdsaleForRetailContract;

    constructor(
        IERC20 _token,
        address _tokenWallet,
        uint256 _minDATStakeAmount,
        uint256 _stakeRate,
        uint256 _stakeRateMultiple,
        address _crowdsaleForRetailAddress,
        IERC20 _crowdsaleToken
    ) Ownable() {
        require(address(_token) != address(0), "Airdrop: The token is the zero address");
        require(_tokenWallet != address(0), "Airdrop: The token wallet is the zero address");
        require(_stakeRate >= 0, "Airdrop: The stake rate must be more than or equal 0");

        token = _token;
        tokenWallet = _tokenWallet;
        minDATStakeAmount = _minDATStakeAmount;
        stakeRate = _stakeRate;
        stakeRateMultiple = _stakeRateMultiple;
        crowdsaleForRetailAddress = _crowdsaleForRetailAddress;
        crowdsaleToken = _crowdsaleToken;

        _crowdsaleForRetailContract = CrowdsaleForRetail(_crowdsaleForRetailAddress);
    }

    // set minDATStakeAmount
    function setMinDATStakeAmount(uint256 amount) public onlyOwner {
        minDATStakeAmount = amount;
    }
    // set stakeRate
    function setStakeRate(uint256 rate) public onlyOwner {
        require(rate <= getMaxStakeRate(), "Airdrop: Exceeds the maximum ratio that can be set");
        stakeRate = rate;
    }
    // set stakeRateMultiple
    function setStakeRateMultiple(uint256 rateMultiple) public onlyOwner {
        stakeRateMultiple = rateMultiple;
    }

    /**
     @dev get stake amount
     */
    function _getDatStakeAmount(address account) internal view returns(uint256) {
        return _crowdsaleForRetailContract.joined(account);
    }

    /**
     * @dev get DAT stake amount of account.
     * @param account the address
     * @return uint256
     */
    function getDatStake(address account) public onlyOwner view returns (uint256) {
        return _getDatStakeAmount(account);
    }

    /**
     @dev get max rate multiple
     */
    function getMaxStakeRate() public onlyOwner view returns (uint256) {
        return rateDenominator.mul(stakeRateMultiple);
    }

    /**
     * @dev get DAO airdrop amount of account.
     * @param account the address
     * @return uint256
     */
    function getActualAirdropAmount(address account) public view returns (uint256) {
        return _getActualAmount(account);
    }

    /**
     * @dev Check if an account DAT balance.
     * @param account the address
     * @return bool
     */
    function checkDatStake(address account) public view returns (bool) {
        uint256 accountStakeAmount = _getDatStakeAmount(account);
        uint256 formatMinDATStakeAmount = minDATStakeAmount * (10**uint256(18));
        return accountStakeAmount >= formatMinDATStakeAmount;
    }

    /**
     * @dev Receive airdrop
     */
    function receiveAirdrop() public {
        address currentAccount = msg.sender;
        require(currentAccount != address(0), "Airdrop: The account is the zero address");
        require(airdropAmount[currentAccount] <= 0, "Airdrop: The account has already received the airdrop");
        require(checkDatStake(currentAccount), "Airdrop: Stake amount does not meet the requirements");

        // random to airdrop amount
        uint256 actualAmount = _getActualAmount(currentAccount);
        if (actualAmount > 0) {
            airdropAmount[currentAccount] = airdropAmount[currentAccount].add(actualAmount);
            // transfer token to receive account
            token.safeTransferFrom(tokenWallet, currentAccount, actualAmount);
            emit transferToken(tokenWallet, currentAccount, actualAmount);
        }
    }

    /**
     * @dev Get actual amount
     */
    function _getActualAmount(address account) internal view returns(uint256) {
        if (stakeRate <= 0) {
            return 0;
        }
        // Calculate the actual amount
        uint256 stakeAmount = _getDatStakeAmount(account);
        uint256 actualAmount = stakeAmount.mul(stakeRate).div(rateDenominator);
        return actualAmount;
    }

    function killSelf(address payable recipientToken) public onlyOwner {
        uint256 contractBalance = token.balanceOf(address(this));
        token.safeTransfer(recipientToken, contractBalance);

        selfdestruct(recipientToken);
    }
}

